import React,{useState} from "react";
import {FaArrowRight}  from 'react-icons/fa';


function Card({info,setShow}){

return(
      
<div className="card" onClick={()=>setShow(info)} >
    <img src="https://kolesa-uploads.ru/-/f8cebc96-e521-4f62-85cf-31b4357decd5/preview-bmw-x5l.jpg" height={"150px"} width={"200px"}></img>
    <ul>
     <li ><FaArrowRight/>{info.marka}</li>
        <li><FaArrowRight/>{info.model}</li>
        <li><FaArrowRight/>{info.year}</li>
        <li><FaArrowRight/>{info.information}</li>
    </ul>
</div>



    )
   
}

export default Card
